        provider_pub = []
        source_coll_provider_pub.find( {'provider_id' => cid} ).each { |doc|
          provider_pub.push doc
        }

        # Get all the provider vid doc
        provider_vid = []
        source_coll_provider_vid.find( {'provider_id' => cid} ).each { |doc|
          provider_vid.push doc
        }

        # Write the provider doc
        if provider_doc
          #puts "prov: #{doc}"
          dest_coll_provider.save( provider_doc )
        end

        # Write the provider assoc doc
        provider_assoc.each { |doc|
          #puts "assoc: #{doc}"
          dest_coll_provider_assoc.save( doc )
        }

        # Write the provider award doc
        provider_award.each { |doc|
          #puts "award: #{doc}"
          dest_coll_provider_award.save( doc )
        }

        # Write the provider cert doc
        provider_cert.each { |doc|
          #puts "cert: #{doc}"
          dest_coll_provider_cert.save( doc )
        }

        # Write the provider edu doc
        provider_edu.each { |doc|
          #puts "edu: #{doc}"
          dest_coll_provider_edu.save( doc )
        }

        # Write the provider exp doc
        provider_exp.each { |doc|
          #puts "exp: #{doc}"
          dest_coll_provider_exp.save( doc )
        }

        # Write the provider lic doc
        provider_lic.each { |doc|
          #puts "lic: #{doc}"
          dest_coll_provider_lic.save( doc )
        }

        # Write the provider mut doc
        provider_mut.each { |doc|
          #puts "mut: #{doc}"
          dest_coll_provider_mut.save( doc )
        }

        # Write the provider pos doc
        provider_pos.each { |doc|
          #puts "pos: #{doc}"
          dest_coll_provider_pos.save( doc )
        }

        # Write the provider prac doc
        provider_prac.each { |doc|
          #puts "prac: #{doc}"
          doc['ins_plan_ids'] = [-1,-1]
          dest_coll_provider_prac.save( doc )
        }

        # Write the provider pub doc
        provider_pub.each { |doc|
          #puts "pub: #{doc}"
          dest_coll_provider_pub.save( doc )
        }

        # Write the provider vid doc
        provider_vid.each { |doc|
          #puts "vid: #{doc}"
          dest_coll_provider_vid.save( doc )
        }

        puts "Finished Provider: #{cid} -- Total left: #{@specific_ids.size} "

      end
    end

